import React, { Component } from "react";
import Link from "next/link";

class Detail extends Component{
    render(){
        const{title1 = "AOWSAY"} = this.props;
        return(              
                <div className="col-lg-3 col-md-3 col-sm-3 ml-2 mr-2 shadow-sm mb-5 bg-dark rounded ">
                <Link href={'/blog/detail'}><a>                    
                    <img src="/static/images/products/1.png" className="img-fluid" />
                    <hr/>                          
                </a></Link>
                <h3 className="text-center">{title1}</h3>
                <hr/>
            </div>                     
        )
    }
}

export default Detail;
